import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import TasksPage from './components/TasksPage';

function App() {
  return (
    <BrowserRouter>

        <Route exact path="/" component={Login} />
        <Route path="/tasks" component={TasksPage} />

    </BrowserRouter>
  );
}

export default App;
